74906, 1, 102446, 'Reinf', 'Reinf', 'xmlns="http://www.reinf.esocial.gov.br/schemas/envioLoteEventos/v1_04_00"'
, 'SELECT     (''ID'' || ''1'' || rpad(substr(e.cd_cgc,1,8), 14, ''0'') || TO_CHAR(SYSDATE,''YYYYMMDD'') || TO_CHAR(SYSDATE,''HHMMSS'')  ||''00001'') nr_id,
	   f.IE_IDENT_AMBIENTE  tpAmb,
	   ''1''                  procEmi,
	   (SELECT MAX(CD_VERSAO) cd FROM APLICACAO_TASY_VERSAO) verProc,
	   ''1''                  tpInsc,
	   substr(e.cd_cgc,1,8)  nrInsc,
	   TO_CHAR(f.dt_validade_inf,''YYYY-MM'')  iniValid,
	   ''''                   fimValid,
	   f.CD_CLASSIF_TRIB    classTrib,
	   DECODE((SELECT COUNT(dt_geracao) FROM CTB_SPED_CONTROLE c WHERE dt_geracao IS NOT NULL),0,0, 1) indEscrituracao,
 	   decode(obter_se_base_corp,''S'',''1'',''0'') indDesoneracao,
	   ''0''                  indAcordoIsenMulta,
	   f.IE_SITUACAO_PJ     indSitPJ,
           ELIMINA_CARACTERE_ESPECIAL(RPAD( SUBSTR((SELECT nm_pessoa_fisica FROM pessoa_fisica WHERE cd_pessoa_fisica = (SELECT em.cd_contabilista cd_contabilista FROM estabelecimento es, empresa em WHERE es.cd_empresa = em.cd_empresa AND cd_estabelecimento = e.cd_estabelecimento)),1,70),70,'' '')) nmCtt,
          (SELECT nr_cpf FROM pessoa_fisica WHERE cd_pessoa_fisica = (SELECT em.cd_contabilista cd_contabilista FROM estabelecimento es, empresa em WHERE es.cd_empresa = em.cd_empresa AND cd_estabelecimento = e.cd_estabelecimento)) cpfCtt,
	   SUBSTR(obter_dados_pf_pj(NULL,e.cd_cgc,''DDT'')||obter_dados_pf_pj(NULL,e.cd_cgc,''T''),1,13) foneFixo,
	   SUBSTR(obter_dados_pf_pj(NULL,e.cd_cgc,''DDT'')||obter_dados_pf_pj(NULL,e.cd_cgc,''T''),1,13) foneCel,
	   RPAD(SUBSTR(obter_dados_pf_pj_estab(e.cd_estabelecimento, NULL, e.cd_cgc, ''M''),1,60),60,'' '') email,
	   ''01950338000177''      cnpjSoftHouse,
	   RPAD(''PHILIPS CLINICAL INFORMATICS - SISTEMAS DE INFORMACAO LTDA'',115,'' '') nmRazao_Soft,
           RPAD(''PHILIPS'',70,'' '') nmCont_Soft,
           ''4731444000''  telefone_Soft,
           RPAD(''philips@philips.com'',60,'' '')   email_Soft
FROM estabelecimento e,
     FIS_REINF_R1000 f
WHERE e.cd_estabelecimento = f.cd_estabelecimento
AND f.nr_sequencia  = :nr_sequencia'
, NULL, 'apapandini',  TO_Date( '10/16/2018 08:39:52 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/16/2018 08:39:52 ', 'MM/DD/YYYY HH:MI:SS ')
