INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74931, 4, 102448, 'infoSusp', 'infoSusp', NULL, 'select	substr(b.cd_ind_suspensao,1,14) codSusp, /*Cd de suspensão atribuído pelo contribuinte*/
	nvl(substr(b.cd_ind_exigibilidade,1,2),01) indSusp, /*Dom 8517*/
	to_char(b.dt_decisao, ''yyyy-mm-dd'') dtDecisao,
	nvl(b.ie_ind_deposito,''S'') indDeposito /*Dep do Montante Integral*/
from 	fis_reinf_r1070 a,
	fis_reinf_exib_trib b
where 	a.nr_sequencia = b.nr_seq_superior
and	a.nr_sequencia = :nr_sequencia'
, NULL, 'apapandini',  TO_Date( '10/16/2018 04:21:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/16/2018 04:21:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74932, 3, 102448, 'dadosProcJud', 'dadosProcJud', NULL, 'SELECT  SUBSTR(obter_uf_ibge(a.cd_municipio),1,2) ufVara,
	LPAD(SUBSTR(a.cd_municipio,1,7)||substr(calcula_digito(''MODULO10'',a.cd_municipio),1,1),7, 0) codMunic,
	SUBSTR(a.cd_ident_vara,1,2) idVara
FROM 	fis_reinf_r1070 a,
	estabelecimento e
WHERE 	e.cd_estabelecimento = a.cd_estabelecimento
AND	a.nr_sequencia = :nr_sequencia
