74956, 5, 102450, 'Reinf', 'Reinf', 'xmlns="http://www.reinf.esocial.gov.br/schemas/envioLoteEventos/v1_04_00"'
, 'SELECT	(''ID'' || ''1'' || rpad(substr(e.cd_cgc,1,8), 14, ''0'') || TO_CHAR(SYSDATE,''YYYYMMDD'') || TO_CHAR(SYSDATE,''HHMMSS'')  ||''00001'') nr_id,
	NVL(a.ie_ambiente,3) tpAmb,
	''1'' procEmi,
	(SELECT MAX(CD_VERSAO) cd FROM APLICACAO_TASY_VERSAO) verProc,
	''1'' tpInsc,
	substr(e.cd_cgc,1,8) nrInsc,
	TO_CHAR(a.dt_inicio_validade, ''YYYY-MM'') iniValid,
	TO_CHAR(a.dt_fim_validade, ''YYYY-MM'') fimValid,
	NVL(a.cd_tipo_processo,1) tpProc,
	SUBSTR(a.nr_processo,1,21) nrProc,
	SUBSTR(a.cd_ind_auditoria,1,1) indAutoria
FROM 	fis_reinf_r1070 a,
	estabelecimento e
WHERE 	e.cd_estabelecimento = a.cd_estabelecimento
AND	a.nr_sequencia = :nr_sequencia'
, NULL, 'apapandini',  TO_Date( '10/16/2018 04:23:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/16/2018 04:23:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
