INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74972, 25, 102451, 'idePrestServ', 'idePrestServ', NULL, 'select rpad(rf.cd_cnpj, 14, ''0'') cnpjPrestador,
        Campo_mascara_casas(sum(rf.vl_bruto_nf), 2)  vlrTotalBruto,
	Campo_mascara_casas(sum(rf.vl_base_trib_inss),2) vlrTotalBaseRet,
	Campo_mascara_casas(sum(rf.vl_retencao_inss) - sum(rf.vl_ret_subcontratado),2)  vlrTotalRetPrinc,
	Campo_mascara_casas((sum(vl_servicos_15) + sum(vl_servicos_20) + sum(vl_servicos_25)),2) vlrTotalRetAdic,
	Campo_mascara_casas(sum(rf.vl_n_retencao_inss),2) vlrTotalNRetPrinc,
	obter_contribuinte_receita(rf.cd_cnpj) indCPRB,
	rf.cd_cnpj cd_cnpj_prestador,
  	max(cd_cno) cd_cno
from  	fis_reinf_notas_r2010 rf
where  	rf.nr_seq_superior = :nr_sequencia
and 	rf.dt_transmissao is null
and 	rf.ie_status is null
and 	rf.cd_cnpj = :cd_cnpj
and	nvl(rf.cd_cno, '' '') = nvl(:cd_cno, '' '')
group   by cd_cnpj
'
, NULL, 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74973, 37, 102451, 'nfs', 'nfs', NULL, 'SELECT	distinct nf.cd_serie_nf serie,
	nf.nr_nota_fiscal numDocto,
	TO_CHAR(nf.dt_emissao, ''rrrr-mm-dd'') dtEmissaoNF,
	Campo_Mascara_casas(rf.VL_BRUTO_NF, 2) vlrBruto,
	NVL(SUBSTR(ELIMINA_CARACTERE_ESPECIAL(obter_texto_sem_quebras(nf.ds_observacao)), 1, 250), ''Sem nenhuma observacao'') obs,
	nf.nr_sequencia nr_seq_nf,
	obter_contribuinte_receita(rf.cd_cnpj) ind_cprb
FROM 	FIS_REINF_NOTAS_R2010 rf,
	nota_fiscal nf
WHERE 	rf.NR_SEQ_NOTA = nf.nr_sequencia
and 	rf.NR_SEQ_SUPERIOR = :nr_sequencia
and 	nf.cd_cgc = :cd_cnpj_prestador
and	nvl(rf.cd_cno, '' '') = nvl(:cd_cno, '' '')'
, NULL, 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74974, 45, 102451, 'infoTpServ', 'infoTpServ', NULL, 'select	tpservico,
	campo_mascara_casas(sum(vlrRetencao),2) vlrRetencao,
	campo_mascara_casas(sum(vlrBaseRet),2) vlrBaseRet,
	campo_mascara_casas(sum(vlrNRetPrinc),2) vlrNRetPrinc,
	campo_mascara_casas(sum(vlrServicos15),2) vlrServicos15,
	campo_mascara_casas(sum(vlrServicos20),2) vlrServicos20,
	campo_mascara_casas(sum(vlrServicos25),2) vlrServicos25,
	campo_mascara_casas(sum(vlrAdicional),2) vlrAdicional,
  	campo_mascara_casas(sum(vl_ret_subcontratado),2) vlrRetSub
from	(select distinct
		ie_tipo_servico tpservico,
		decode(obter_contribuinte_receita(n.cd_cnpj),0,t.vl_base_calculo * 0.11,t.vl_base_calculo * 0.035) vlrRetencao,
		t.vl_base_calculo vlrBaseRet,
		decode(obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2010''),''S'',t.vl_tributo,0) vlrNRetPrinc,
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 6) vlrServicos15,
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 7) vlrServicos20,
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 8) vlrServicos25,
		(fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 2) +
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 3) +
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 4)) vlrAdicional,
		n.vl_ret_subcontratado
        from	nota_fiscal_item i,
		nota_fiscal_trib t,
		material_fiscal m,
		fis_reinf_r2010 fr,
		fis_reinf_notas_r2010 n
	where   t.nr_sequencia = i.nr_sequencia
    	and 	m.cd_material = i.cd_material
    	and 	fr.cd_tributo = t.cd_tributo
	and 	t.vl_tributo <> 0
    	and 	fr.nr_sequencia = :nr_sequencia
    	and 	i.nr_sequencia = :nr_seq_nf
	and 	n.nr_seq_nota = i.nr_sequencia
	group by ie_tipo_servico,
		decode(obter_contribuinte_receita(n.cd_cnpj),0,t.vl_base_calculo * 0.11,t.vl_base_calculo * 0.035),
		t.vl_base_calculo, t.tx_tributo,
		decode(obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2010''),''S'',t.vl_tributo,0),
		t.tx_tributo, t.vl_base_calculo,
    		n.vl_ret_subcontratado
	union
	select 	distinct
		ie_tipo_servico tpservico,
		decode(obter_contribuinte_receita(n.cd_cnpj),0,t.vl_base_calculo * 0.11,t.vl_base_calculo * 0.035) vlrRetencao,
		sum(t.vl_base_calculo) vlrBaseRet,
		decode(obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2010''),''S'',t.vl_tributo,0) vlrNRetPrinc,
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 6) vlrServicos15,
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 7) vlrServicos20,
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 8) vlrServicos25,
		(fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 2) +
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 3) +
		fis_obter_valor_apo_esp_2010(t.tx_tributo, t.vl_base_calculo, 4)) vlrAdicional,
		n.vl_ret_subcontratado
	from	nota_fiscal_item i,
		nota_fiscal_item_trib t,
		material_fiscal m,
		fis_reinf_r2010 fr,
		fis_reinf_notas_r2010 n
	where 	m.cd_material = i.cd_material
	and 	i.nr_item_nf = t.nr_item_nf
	and 	i.nr_sequencia = t.nr_sequencia
	and 	t.vl_tributo <> 0
	and 	fr.cd_tributo = t.cd_tributo
	and 	fr.nr_sequencia = :nr_sequencia
	and 	i.nr_sequencia = :nr_seq_nf
	and 	n.nr_seq_nota = i.nr_sequencia
	group by ie_tipo_servico,
		decode(obter_contribuinte_receita(n.cd_cnpj),0,t.vl_base_calculo * 0.11,t.vl_base_calculo * 0.035),
		t.tx_tributo,
		n.vl_ret_subcontratado,
		decode(obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2010''),''S'',t.vl_tributo,0),
		t.tx_tributo, t.vl_base_calculo)
group by tpservico'
, NULL, 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74975, 2, 102451, 'evento', 'evento', NULL, 'select	(nr_id || adiciona_zeros_esquerda(rownum,5)) nr_id,
	indRetif,
	nrRecibo,
	perApur,
	tpAmb,
	procEmi,
	verProc,
	tpInsc,
	nrInsc,
	tpInscEstab,
	nrInscEstab,
	indObra,
	cd_cnpj,
	cd_cno
from (	select	(''ID'' || ''1'' || rpad(substr(e.cd_cgc,1,8), 14, ''0'') || to_char(sysdate,''YYYYMMDD'') || to_char(sysdate,''hh24miSS''))  nr_id,
		f.ie_ind_retif	indRetif,
		f.nr_recibo	nrRecibo,
		to_char( f.dt_competencia, ''rrrr-mm'')   perApur,
		f.cd_ident_ambiente  tpAmb,
		''1''	procEmi,
		(select max(cd_versao) cd from aplicacao_tasy_versao) verProc,
		''1''	tpInsc,
		substr(e.cd_cgc,1,8)	nrInsc,
		decode(n.cd_cno, null, ''1'', ''4'')	tpInscEstab,
		decode(n.cd_ind_obra, 0, e.cd_cgc, decode(n.cd_cno, null, e.cd_cgc, n.cd_cno))	nrInscEstab,
		n.cd_ind_obra	indObra,
		n.cd_cnpj	cd_cnpj,
		n.cd_cno cd_cno
	from	estabelecimento e,
		fis_reinf_r2010 f,
		fis_reinf_notas_r2010 n
	where	e.cd_estabelecimento = f.cd_estabelecimento
	and	f.nr_sequencia  = :nr_sequencia
	and	n.nr_seq_superior = f.nr_sequencia
	and	n.dt_transmissao is null
	and	n.ie_status is null
	group by
		(''ID'' || ''1'' || rpad(substr(e.cd_cgc,1,8), 14, ''0'') || to_char(sysdate,''YYYYMMDD'') || to_char(sysdate,''hh24miSS'')),
		f.ie_ind_retif,
		f.nr_recibo,
		to_char( f.dt_competencia, ''rrrr-mm''),
		f.cd_ident_ambiente,
		substr(e.cd_cgc,1,8),
		''1'',
		e.cd_cgc,
		''0'',
		n.cd_ind_obra,
		n.cd_cnpj,
		n.cd_cno)
'
, NULL, 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 08:41:00 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
