INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74996, 39, 102453, 'infoTpServ', 'infoTpServ', NULL, 'SELECT   tpservico,Campo_mascara_casas(Sum(vlrRetencao),2) vlrRetencao,
         Campo_mascara_casas(Sum(vlrBaseRet),2) vlrBaseRet,
         Campo_mascara_casas(Sum(vlrNRetPrinc),2) vlrNRetPrinc
FROM     (  SELECT ie_tipo_servico tpservico, (t.vl_base_calculo * 0.11) vlrRetencao,t.vl_base_calculo vlrBaseRet,
                   Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0) vlrNRetPrinc
                  FROM nota_fiscal_item i,nota_fiscal_trib t,material_fiscal m,fis_reinf_r2020 fr,fis_reinf_notas_r2020 n
                  WHERE t.nr_sequencia = i.nr_sequencia AND n.nr_seq_nota = i.nr_sequencia
                  AND m.cd_material = i.cd_material AND fr.cd_tributo = t.cd_tributo
                  AND fr.nr_sequencia = :nr_sequencia AND i.nr_sequencia = :nr_seq_nf
                  GROUP BY ie_tipo_servico,(t.vl_base_calculo * 0.11),t.vl_base_calculo,
                           Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0) UNION
                  SELECT   ie_tipo_servico tpservico,(t.vl_base_calculo * 0.11) vlrRetencao, sum(t.vl_base_calculo) vlrBaseRet,
                           Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0) vlrNRetPrinc
                  from     nota_fiscal_item i,nota_fiscal_item_trib t,material_fiscal m,fis_reinf_r2020 fr,fis_reinf_notas_r2020 n
                  WHERE m.cd_material = i.cd_material AND i.nr_item_nf = t.nr_item_nf AND i.nr_sequencia = t.nr_sequencia
                  AND fr.cd_tributo = t.cd_tributo AND fr.nr_sequencia = :nr_sequencia
                  AND i.nr_sequencia = :nr_seq_nf AND n.nr_seq_nota = i.nr_sequencia
                  GROUP BY ie_tipo_servico,(t.vl_base_calculo * 0.11),
                           Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0) UNION
                  SELECT   ie_tipo_servico  tpservico,(t.vl_base_calculo * 0.11) vlrRetencao,t.vl_base_calculo vlrBaseRet,
                           Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0) vlrNRetPrinc
                  FROM nota_fiscal_item i, nota_fiscal_trib t, procedimento_fiscal pf, fis_reinf_r2020 fr, fis_reinf_notas_r2020 n
                  WHERE    t.nr_sequencia = i.nr_sequencia AND n.nr_seq_nota = i.nr_sequencia
                  AND      pf.cd_procedimento = i.cd_procedimento AND fr.cd_tributo = t.cd_tributo
                  AND      fr.nr_sequencia = :nr_sequencia AND i.nr_sequencia = :nr_seq_nf
                  GROUP BY ie_tipo_servico,(t.vl_base_calculo * 0.11),t.vl_base_calculo,
                           Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0) UNION
                  SELECT   ie_tipo_servico tpservico,(t.vl_base_calculo * 0.11) vlrRetencao, sum(t.vl_base_calculo) vlrBaseRet,
                           Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0) vlrNRetPrinc
                  FROM nota_fiscal_item i,nota_fiscal_item_trib t,procedimento_fiscal pf,
                       fis_reinf_r2020 fr,fis_reinf_notas_r2020 n
                  WHERE pf.cd_procedimento = i.cd_procedimento AND i.nr_item_nf = t.nr_item_nf AND i.nr_sequencia = t.nr_sequencia
                  AND fr.cd_tributo = t.cd_tributo AND fr.nr_sequencia = :nr_sequencia
                  AND i.nr_sequencia = :nr_seq_nf AND n.nr_seq_nota = i.nr_sequencia
                  GROUP BY ie_tipo_servico,(t.vl_base_calculo * 0.11),
			   Decode(Obter_se_possui_processo(n.nr_seq_nota,fr.nr_sequencia,''2020''),''S'',t.vl_tributo,0)) GROUP BY tpservico'
, NULL, 'apapandini',  TO_Date( '10/17/2018 09:01:43 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 09:01:43 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
