INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
75001, 10, 102453, 'infoProcRetPr', 'infoProcRetPr', NULL, 'select cd_tipo_processo tpProcRetPrinc,
       nr_processo nrProcRetPrinc,
       cd_ind_exigibilidade codSuspPrinc,
       Campo_mascara_casas(sum(vl_n_retencao_inss),2) valorPrinc
from   fis_reinf_r1070 a,
       fis_reinf_exib_trib b,
       fis_reinf_notas_r2020 c,
       fis_reinf_r2020 d
where  a.cd_cnpj = :cd_cnpj_tomador
and    a.nr_sequencia = b.nr_seq_superior
and    a.cd_cnpj = c.cd_cnpj
and    c.nr_seq_superior = d.nr_sequencia
and    d.nr_sequencia = :nr_sequencia
and    d.cd_tributo = a.cd_tributo
and    to_date(d.dt_competencia,''dd/mm/yyyy'') between to_date(a.dt_inicio_validade,''dd/mm/yyyy'') and fim_dia(to_date(nvl(a.dt_fim_validade, sysdate),''dd/mm/yyyy''))
group by cd_tipo_processo,
         nr_processo,
	 cd_ind_exigibilidade'
, NULL, 'apapandini',  TO_Date( '10/17/2018 09:01:43 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 09:01:43 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
74989, 2, 102453, 'Evento', 'Evento', NULL, 'select      (nr_id || adiciona_zeros_esquerda(rownum,5)) nr_id,
            indRetif,
	    nrRecibo,
	    perApur,
	    tpAmb,
	    procEmi,
	    verProc,
	    tpInsc,
	    nrInsc,
	    tpInscEstabPrest,
	    nrInscEstabPrest,
	    cd_cnpj
from (  SELECT
	(''ID'' || ''1'' || rpad(substr(e.cd_cgc,1,8), 14, ''0'') || TO_CHAR(SYSDATE,''YYYYMMDD'') || TO_CHAR(SYSDATE,''hh24miSS''))  nr_id,
	DECODE(a.ie_retificacao,''S'',2,1) indRetif,
	a.nr_recibo nrRecibo,
	TO_CHAR(a.dt_competencia,''yyyy-mm'') perApur,
	NVL(a.ie_ambiente,3) tpAmb,
	1 procEmi,
	(SELECT MAX(CD_VERSAO) cd FROM APLICACAO_TASY_VERSAO) verProc,
	1 tpInsc,
	substr(e.cd_cgc,1,8) nrInsc,
	1 tpInscEstabPrest,
	e.cd_cgc nrInscEstabPrest,
	n.cd_cnpj cd_cnpj
FROM 	fis_reinf_r2020 a,
	estabelecimento e,
	fis_reinf_notas_r2020 n
WHERE 	a.cd_estabelecimento = e.cd_estabelecimento
AND	a.nr_sequencia = :nr_sequencia
and 	n.nr_seq_superior = a.nr_sequencia
and 	n.dt_transmissao is null
and 	n.ie_status is null
group   by
        (''ID'' || ''1'' || rpad(substr(e.cd_cgc,1,8), 14, ''0'') || TO_CHAR(SYSDATE,''YYYYMMDD'') || TO_CHAR(SYSDATE,''hh24miSS'')),
	DECODE(a.ie_retificacao,''S'',2,1),
        a.nr_recibo,
        TO_CHAR(a.dt_competencia,''yyyy-mm''),
	NVL(a.ie_ambiente,3),
	1,
        1,
        substr(e.cd_cgc,1,8),
        1,
        e.cd_cgc,
        n.cd_cnpj )'
, NULL, 'apapandini',  TO_Date( '10/17/2018 09:01:43 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 09:01:43 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
