74994, 24, 102453, 'ideTomador', 'ideTomador', NULL, 'SELECT 	1 tpInscTomador,
	a.cd_cnpj nrInscTomador,
	0 indObra,
	Campo_Mascara_casas(SUM(a.vl_bruto_nf),2)   vlrTotalBruto,
	Campo_Mascara_casas(SUM(a.vl_base_trib_inss),2) vlrTotalBaseRet,
	Campo_mascara_casas(Sum(a.vl_retencao_inss),2)  vlrTotalRetPrinc,
        Campo_mascara_casas(Sum(a.vl_n_retencao_inss),2) vlrTotalNRetPrinc,
	a.cd_cnpj cd_cnpj_tomador
FROM 	fis_reinf_notas_r2020 a,
	nota_fiscal n
WHERE 	a.nr_seq_nota = n.nr_sequencia
AND	a.cd_cnpj IS NOT NULL
AND 	a.nr_seq_superior = :nr_sequencia
AND 	a.dt_transmissao IS NULL
AND 	a.ie_status IS NULL
AND     a.cd_cnpj = :cd_cnpj
GROUP BY a.cd_cnpj,
	 n.cd_cgc_emitente'
