INSERT INTO XML_ELEMENTO( NR_SEQUENCIA, NR_SEQ_APRESENTACAO, NR_SEQ_PROJETO, NM_ELEMENTO, DS_ELEMENTO, DS_CABECALHO, DS_SQL, DS_GRUPO, NM_USUARIO, DT_ATUALIZACAO, IE_CRIAR_NULO, NM_USUARIO_NREC, DT_ATUALIZACAO_NREC, IE_TIPO_ELEMENTO, IE_CRIAR_ELEMENTO, IE_TIPO_COMPLEXO, DS_SQL_2, DS_NAMESPACE, QT_MIN_OCOR, QT_MAX_OCOR, NR_SEQ_ITEM_XSD ) VALUES (
75028, 1, 102456, 'Reinf', 'Reinf', 'xmlns="http://www.reinf.esocial.gov.br/schemas/envioLoteEventos/v1_04_00"'
, 'SELECT 	(''ID'' || ''1'' || rpad(substr(e.cd_cgc,1,8), 14, ''0'') || TO_CHAR(SYSDATE,''YYYYMMDD'') || TO_CHAR(SYSDATE,''HHMMSS'')  ||''00001'') nr_id,
	TO_CHAR( f.dt_geracao, ''rrrr-mm'')   perApur,
	f.IE_TIPO_AMBIENTE  tpAmb,
	''1'' procEmi,
	(SELECT MAX(CD_VERSAO) cd FROM APLICACAO_TASY_VERSAO) verProc,
	''1''  tpInsc,
	substr(e.cd_cgc,1,8)  nrInsc,
	RPAD( SUBSTR(ELIMINA_CARACTERE_ESPECIAL((SELECT nm_pessoa_fisica FROM pessoa_fisica WHERE cd_pessoa_fisica = (SELECT em.cd_contabilista cd_contabilista FROM estabelecimento es, empresa em WHERE es.cd_empresa = em.cd_empresa AND cd_estabelecimento = e.cd_estabelecimento))),1,70),70,'' '') nmResp,
	(SELECT nr_cpf FROM pessoa_fisica WHERE cd_pessoa_fisica = (SELECT em.cd_contabilista cd_contabilista FROM estabelecimento es, empresa em WHERE es.cd_empresa = em.cd_empresa AND cd_estabelecimento = e.cd_estabelecimento)) cpfResp,
	SUBSTR(obter_dados_pf_pj(NULL,e.cd_cgc,''DDT'')||obter_dados_pf_pj(NULL,e.cd_cgc,''T''),1,13) telefone,
	RPAD(SUBSTR(obter_dados_pf_pj_estab(e.cd_estabelecimento, NULL, e.cd_cgc, ''M''),1,60),60,'' '') email,
	f.IE_CONTRAT_SERV_PREV  evtServTm,
	f.IE_PREST_SERV_PREV evtServPr,
	''N'' evtAssDespRec,
	f.ie_possui_repasse evtAssDespRep,
	''N'' evtComProd,
	''N'' evtCPRB,
	f.IE_INF_PGMTO evtPgtos,
	(select to_char(a.dt_geracao, ''rrrr-mm'')
	from   fis_reinf_r2099 a
	where  a.nr_sequencia  = f.nr_sequencia
	and    ie_contrat_serv_prev = ''N''
	and    ie_prest_serv_prev = ''N''
	and    ie_possui_repasse = ''N''
	and    ie_inf_pgmto = ''N'') compSemMovto
FROM 	estabelecimento e,
	FIS_REINF_R2099 f
WHERE	 e.cd_estabelecimento = f.cd_estabelecimento
AND 	f.nr_sequencia  = :nr_sequencia'
, NULL, 'apapandini',  TO_Date( '10/17/2018 02:22:57 ', 'MM/DD/YYYY HH:MI:SS ')
, 'S', 'apapandini',  TO_Date( '10/17/2018 02:22:57 ', 'MM/DD/YYYY HH:MI:SS ')
, 'E', 'S', 'S', NULL, NULL, NULL, NULL, NULL);
